/*Table structure for table `shipment_locations` */

DROP TABLE IF EXISTS `shipment_locations`;

CREATE TABLE `shipment_locations` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `shipment_id` int(11) DEFAULT NULL,
  `sequence_no` int(3) DEFAULT NULL,
  `from_area_id` int(11) NOT NULL,
  `from_location_id` int(11) DEFAULT NULL,
  `to_area_id` int(11) NOT NULL,
  `to_location_id` int(11) DEFAULT NULL,
  `expected_delivery_date` date DEFAULT NULL,
  `courier_id` int(11) DEFAULT NULL,
  `confirmation_id` int(11) DEFAULT NULL,
  `status_id` int(11) DEFAULT NULL,
  `delivery_latitude` varchar(50) DEFAULT NULL,
  `delivery_longitude` varchar(50) DEFAULT NULL,
  `delivery_comments` text,
  `confirmation_comments` text,
  `modified` datetime DEFAULT NULL,
  `created` datetime DEFAULT NULL,
